import React from 'react';
import Navbar from '../components/widgets/Navbar';

const mainImage={
    width: '30%',
}

const textFields={
    marginLeft: '10%',
    fontFamily: 'Roboto Mono',
    textAlign: 'left',
    fontSize: '22px',
    color: '#4a4a4a',
}

class aboutPage extends React.Component{

    render(){
        return(
            <div>
                <Navbar />
                <div style={{marginLeft: '5%', marginRight: '5%', display: 'flex'}}>
                    <img src={require('../components/images/about/aboutPagePhoto.jpg')} alt='Pari :)' style={mainImage}/>
                    <div className='pageStyles'>
                        <p style={{color: '#4a4a4a'}}>
                            Hi, I'm Paridhi. I'm currently pursuing a B.S. in Computer Science with a minor in Design at the 
                            University of California, San Diego. 
                            <br />
                            <br />
                            This summer, I served as a Tutor for Android Development at Facebook University. I currently intern 
                            at a San Deigo based startup, Infopost, as a Web Developer and also serve on the board of <a href='#'> Design Co. at UCSD </a>. 
                            <br />
                            <br />
                            On the left, I'm featured 
                        </p>
                    </div>
                </div>
            </div>
        );
    }
}

export default aboutPage;
